import React, {Component} from 'react'

class Checkbox extends Component{

    state = {
        completed: false
    }

    handleChange(event){
        const{name, checked} = event.target
        this.setState({ [name]: checked}) 
      }

    render(){

        return(
            <form>
                <input type = "Checkbox"
                    name = 'completed'
                    checked = {this.state.completed}
                    onChange = {this.handleChange}
                ></input>
            </form>
        )
    }
}


export default Checkbox
